function toggleList(anID)
{
	arrID = anID.split("||");
	theID = arrID[0].substr(1);
	title = arrID[1];
	
	if (document.getElementById('r' + theID))
		document.body.removeChild(document.getElementById('r' + theID));
	else
	{
		popDiv = document.createElement('div');
		popDiv.id = 'r' + theID;
		popDiv.setAttribute('style','text-align:left;width:150px;-moz-box-shadow: 3px 3px 5px #000;color:#000;padding:4px;top:0px;left:0px;background-color:#fff;font-size:8pt;font-family:verdana;position:absolute;z-index:30;border:1px solid #000;');

		//search engines
		popDiv.appendChild(addSearch('NZBIndex.nl',nzbi,'http://nzbindex.nl/search?q=',title,''));
		popDiv.appendChild(addSearch('KickAssTorrents',kat,'http://www.kickasstorrents.com/search/',title,'/'));
		popDiv.appendChild(addSearch('thepiratebay',tpb,'https://thepiratebay.org/search/',title,'/0/99/0'));
		popDiv.appendChild(addSearch('Demonoid',demonoid,'http://www.demonoid.me/files/?query=',title,''));
		popDiv.appendChild(addSearch('ISOHunt',isohunt,'http://isohunt.com/torrents/?ihq=',title,''));
		popDiv.appendChild(addSearch('NZBMatrix',nzbmatrix,'http://nzbmatrix.com/nzb-search.php?search=',title,''));

		var pos = findPos(document.getElementById("n" + theID));
		popDiv.style.top = pos[1] + "px";
		popDiv.style.left = pos[0]+52+ "px";
		popDiv.addEventListener("click",function(){toggleList(this.id);},true);
		document.body.appendChild(popDiv);
	}
	document.getElementById("img_" + theID).src = (document.getElementById("r" + theID)) ? collapseimg : expandimg;
}

function addSearch(theSite,icon,queryString,title,extra)
{
	newBTN = document.createElement('div');
	newBTN.title = 'Search ' + theSite + ' for ' + title;
	newBTN.setAttribute("style","vertical-align:middle;margin-top:2px;margin-bottom:4px;");
	newLink = document.createElement('a');
	newLink.href = queryString + title + extra;
	newLink.target = "_blank";
	newLink.setAttribute('style','font-size:8pt;color:#03585F;text-decoration:none;');
	newLink.innerHTML = '<img class="none" title="Search ' + theSite + ' for ' + title + '" src="' + icon + '" style="margin-left:3px;margin-right:5px;" border="0"><span style="padding-left:5px;position:relative;top:-3px;border-left:1px solid #000;">' + theSite + "</span>";
	newBTN.appendChild(newLink); 
	return newBTN;
}
function makeButtons(title,filename,num,extra)
{
	newDiv = document.createElement('span');
	newDiv.id = "n" + num;
	//default buttons
	if (isNaN(extra)) extra = "";
	var unLink = 'http://binsearch.info/?q=' + filename + '&max=100&adv_age=70&server=' + extra;
	var unHTML = '<a href="' + unLink + '" target="_blank"><img title="Search binsearch.info for ' + title + '" src="' + uicon + '" style="margin-left:3px !important;margin-right:3px !important;padding:0px !important;border:none !important;"><\/a>';
	var torLink = 'http://www.torrentz.com/search?q=' + title;
	var torHTML = '<a href="' + torLink + '" target="_blank"><img title="Search torrentz.com for ' + title + '" src="' + ticon + '" style="margin-right:3px !important;padding:0px !important;border:none !important;"><\/a>';
	var theHTML = unHTML + torHTML;

	newSpan = document.createElement('span');
	newSpan.innerHTML = theHTML;
	btn = document.createElement('span');
	btn.innerHTML = '<a href="javascript:void(0);"><img alt="+" title="More Search Options" id="img_' + num + '"style="border:none !important;padding:0px !important;" src="' + expandimg + '"></a>';
	btn.id = "t" + num + '||' + title;
	btn.addEventListener("click",function(){toggleList(this.id);},true);
	newDiv.appendChild(newSpan);
	newDiv.appendChild(btn);
	return newDiv;
}

function getfilename(parent, link, num)
{	
	GM_xmlhttpRequest({
	method:"GET",
	url:link,
	onload:function(details)
	{
		Wii = "";
		if (details.responseText.match(/Wii #/))
			Wii = 2;
		if (details.responseText.match(/nowrap>\n[ \t]+File name.*?\n.*?\n.*?\n.*?\n[ \t]+(.*?)\n.*?<\/td/i)) //NDS Release
			filename = details.responseText.match(/nowrap>\n[ \t]+File name.*?\n.*?\n.*?\n.*?\n[ \t]+(.*?)\n.*?<\/td/i)[1];
		(details.responseText.match(/<span style="font-size: 10px;">\n[ \t]+(.*)\n<\/span>\n/)) ?
			title = details.responseText.match(/<span style="font-size: 10px;">\n[ \t]+(.*)\n<\/span>\n/)[1] :
			title = parent.innerHTML.replace("#",'');
		if (filename.length < 5) filename = title;
		if (filename.indexOf('.zip') > -1 || filename.indexOf('.rar') > -1) filename = filename.substr(0, filename.length-4);
		parent.parentNode.insertBefore(makeButtons(title,filename,num,Wii),parent.nextSibling);
	}
	})
}

